export function getFontFileForCodePoint(codePoint: number): string | null {
  for (const range of FONT_SUBSET_RANGES) {
    if (codePoint >= range.start && codePoint <= range.end) {
      return range.file;
    }
  }

  return null;
}

export function getFontFileForChar(char: string): string | null {
  if (!char) return null;
  const codePoint = char.codePointAt(0);
  if (codePoint === undefined) return null;
  return getFontFileForCodePoint(codePoint);
}

export function getFontFilesForText(text: string): string[] {
  const files = new Set<string>();

  for (const char of text) {
    const file = getFontFileForChar(char);
    if (file) files.add(file);
  }

  return [...files];
}

export type ResolvedChineseFont = {
  file: string;
  font: ArrayBuffer;
};

export const resolveChineseText = async (
  input: string,
  fetchSrc: (src: string) => Promise<Response>,
): Promise<ResolvedChineseFont[]> => {
  const fontFiles = getFontFilesForText(input);
  const fonts = await Promise.all(
    fontFiles.map(async (file): Promise<ResolvedChineseFont> => {
      const font = await fetchSrc(`/fonts/slice/${file}`).then((res) =>
        res.arrayBuffer(),
      );
      return { file, font };
    }),
  );
  return fonts;
};

export const getChineseFontAlias = (file: string) => {
  return `noto_${file.replace(/\W+/g, "_")}`;
};

export const drawChineseTextCentered = (
  doc: PDFKit.PDFDocument,
  input: string,
  chineseFontAliases: Map<string, string>,
  fallbackFont: string,
) => {
  const chars = [...input];

  const lineWidth = chars.reduce((width, char) => {
    const file = getFontFileForChar(char);
    const alias = file ? chineseFontAliases.get(file) : undefined;
    doc.font(alias ?? fallbackFont);
    return width + doc.widthOfString(char);
  }, 0);

  const y = doc.y;
  let x = (doc.page.width - lineWidth) / 2;

  for (const char of chars) {
    const file = getFontFileForChar(char);
    const alias = file ? chineseFontAliases.get(file) : undefined;
    doc.font(alias ?? fallbackFont).text(char, x, y, { lineBreak: false });
    x += doc.widthOfString(char);
  }

  doc.x = doc.page.margins.left;
  doc.y = y + doc.currentLineHeight(true);
};
